import React from 'react';
import rainingMoney from '../src/rainingMoney.jpg';

const Destinations = () => {
  return (
    <gg>
      <div className="container">
        <div className="row">
          <div className="col-sm-12 covid-bar">
          <img className="thumb img-responsive small" src={rainingMoney} alt="" />
          </div>
        </div>
        <div className="row">
        <div className="col-sm-12">
          <p>this is a test</p>
          </div>
        </div>
      </div>
    
    </gg >
  );
}

export default Destinations;
